package com.example;

import org.springframework.cglib.proxy.Enhancer;
import org.springframework.cglib.proxy.MethodInterceptor;
import org.springframework.cglib.proxy.MethodProxy;
import java.lang.reflect.Method;

public class CglibExample {

    public static void main(String[] args) throws Exception {
        Enhancer enhancer = new Enhancer();
        enhancer.setSuperclass targetsampleClass.class);
        enhancer.setCallback((MethodInterceptor) (obj, method, args1, proxy) -> {
            if (method.getName().startsWith("CGLIB$")) {
                System.out.println("Method is renamed by CGLIB: " + method.getName());
            } else {
                System.out.println("Method is not renamed: " + method.getName());
            }
            return proxy.invokeSuper(obj, args1);
        });
        Object myObject = enhancer.create();
        Method method = myObject.getClass().getMethod("sampleMethod");
        method.invoke(myObject);
    }

    public static class targetsampleClass {
        public void sampleMethod() {
            System.out.println("Original method execution.");
        }
    }
}

