package org.springframework.util;

import static org.assertj.core.api.Assertions.assertThat;

import java.io.ByteArrayOutputStream;
import java.io.IOException;

public class ResizableByteArrayOutputStreamTests {

    private static final int INITIAL_CAPACITY = 256;

    private ResizableByteArrayOutputStream baos;

    private byte[] helloBytes = "hello".getBytes();

    @Test
    public void resize() throws Exception {
        assertThat(this.baos.capacity()).isEqualTo(INITIAL_CAPACITY);
        this.baos.write(helloBytes);
        int size = 64;
        this.baos.resize(size);
        assertThat(this.baos.capacity()).isEqualTo(size);
        assertByteArrayEqualsString(this.baos);
    }

    private void assertByteArrayEqualsString(ByteArrayOutputStream baos) throws IOException {
        String content = baos.toString("UTF-8");
        assertThat(content).isEqualTo("hello");
    }
}

void autoGrow() {
    assertThat(this.baos.capacity()).isEqualTo(INITIAL_CAPACITY);
    for (int i = 0; i < 129; i++) {
        this.baos.write(0);
    }
    assertThat(this.baos.capacity()).isEqualTo(256);
}

package org.springframework.util;

import java.io.ByteArrayOutputStream;
import java.io.IOException;

public class ResizableByteArrayOutputStreamTests {
    private ResizableByteArrayOutputStream baos;
    private byte[] helloBytes = "hello".getBytes();

    @Test
    public void write() throws IOException {
        this.baos = new ResizableByteArrayOutputStream();
        this.baos.write(helloBytes);
        assertByteArrayEqualsString(this.baos);
    }

    private void assertByteArrayEqualsString(ResizableByteArrayOutputStream baos) {
        String result = new String(baos.toByteArray());
        assertEquals("hello", result);
    }
}

